import React from "react";
import StockDetail from "./StockDetail";
import StockChartTabs from "./StockChartTabs";

const SinglePage = () => {
    return <>
        <StockDetail/>
    <StockChartTabs tabs={[{index: 1, content: "1일 짜리 그래프 그릴거야", title: "1일"},
                        {index: 2, content: "1주일 짜리 그래프 그릴거야", title: "1주"},
                        {index: 3, content: "3주 짜리 그래프 그릴거야", title: "3주"},
        {index: 3, content: "3주 짜리 그래프 그릴거야", title: "3주"},
    ]}/>
    </>
}

export default SinglePage;
